import Button from "@mui/material/Button";
import "../Style/App.css";

function App() {
    return (
        <div className="App">

            <Button
                variant="contained"
                color="primary">
                Contained
            </Button>
            <Button
                variant="contained"
                color="secondary">
                Contained
            </Button>
            <Button
                variant="contained"
                color="default">
                Contained
            </Button>


        </div>
    );
}

export default App;
